!function($) {
    "use strict";
    jQuery(document).on("click", ".pwa-button-switch", function(event) {
        var data = jQuery(this).data();
        event.preventDefault(), jQuery.post(pwaFrontendObject.ajax_url, {
            action: "frontend_pwa_app",
            security: pwaFrontendObject._nonce,
            data: data
        }, function(response) {
            response.success || (document.cookie = "classicCookie=false;path=/;secure", window.location.replace(response.data.url));
        });
    });
}(jQuery);